import { configureStore } from "@reduxjs/toolkit";
import jdReducer from "./slices/jdSlice";
import resumeReducer from "./slices/resumeSlice";

const store = configureStore({
  reducer: {
    jdReducer,
    resumeSlice,
  },
});

export default store;
